{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/norqui/electric-vehicle-wa?scriptVersionId=239532618\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"00f11982","metadata":{"_cell_guid":"d107b96c-beea-4bb0-9d08-085c71f05418","_uuid":"8d62d0ef-8331-4a5a-a440-0118c3510891","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.01775,"end_time":"2025-05-13T18:30:12.524757","exception":false,"start_time":"2025-05-13T18:30:12.507007","status":"completed"},"tags":[]},"source":["# Electric Vehicle Populaltion in Washington State"]},{"cell_type":"markdown","id":"e8aea7bb","metadata":{"_cell_guid":"8dfe0fc8-87d0-4dfa-bf5d-e5710ec6b9ee","_uuid":"d89173c0-14e2-494a-93d9-e44d19a68cee","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.017766,"end_time":"2025-05-13T18:30:12.559739","exception":false,"start_time":"2025-05-13T18:30:12.541973","status":"completed"},"tags":[]},"source":["\n","## 1) Introduction \n","\n","The dataset obtained from [Electric Vehicle Population Data](https://data.wa.gov/Transportation/Electric-Vehicle-Population-Data/f6w7-q2d2/about_data) contains information on the Battery Electric Vehicles (BEVs) and Plug-in Hybrid Electric Vehicles (PHEVs) registered through Washington State Department of Licensing (DOL).  The owner of the dataset is the Department of Licensing, in this way, the data format is primary  and internal. This dataset is open under the Open Database License [ODbl](https://opendatacommons.org/licenses/odbl/1-0/). \n","\n","The data consists of 17 columns describing some characteristics of the electric vehicles registered as March 21, 2025. \n","\n","* Observation: An important note about this data is that the *Electric Range* attribute is no longer maintained for *Battery Electric Vehicles* (BEVs), as newer *BEVs* typically have an electric range of 30 miles or more. A value of zero (0) was entered where the electric range had not been researched. It is not specified from which date the recording stopped or from which year vehicles are considered to have more than 30 miles of range. However, this observation will be taken into account in this analysis\n","\n","\n","### Objective:\n","Understand which are the most frequently characteristics registered in the data set. \n","\n","### Particular objective: \n","Learn to work with missing  and zero values as well as with outliers.\n","\n","\n","\n","## Asking Questions\n","\n","To analyse data, the following questions arise:\n","\n","\n","* What is the time interval in the recollected data? \n","* How many registered BEV's and Plug-in electric vehicles are there? \n","* How are the electric vehicle types distributed across the model year?  \n","* How many manufactures (makes)  are registered? Which are the most registered makes?\n","* How many models are in data, Which are the models with highest enrollments?\n","* What is the percentage of eligibility by electric type?\n","* Which is the city with most registration?\n","\n","\n","\n","\n","\n","## 2) Preparing Data for  Exploration\n","\n","### Exploring data\n","\n","In most of my analysis I use the fantastic dplyr library and several of its verbs to manipulate data. I also use the library skimr to get detailed information about the structure and statistics of the data set. For plots I use ggplot and plotly."]},{"cell_type":"code","execution_count":1,"id":"a9bb551c","metadata":{"_cell_guid":"8fb4d9dc-be9b-40e2-8eba-8c4d0132ef61","_uuid":"d7364515-b21d-4574-8adf-42e4b43225fe","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:30:12.603884Z","iopub.status.busy":"2025-05-13T18:30:12.600845Z","iopub.status.idle":"2025-05-13T18:30:14.344253Z","shell.execute_reply":"2025-05-13T18:30:14.342075Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.769962,"end_ti