is, and I rename columns and some rows. \n","* Select: I choose to work with the following 7 features: \"city\", \"make,  model\" , \"model_year\", \"electric_range\",  \"clean_alternative_fuel_vehicle_cafv_eligibility\", \"electric_vehicle_type\".\n","* Rename columns: For easy manipulation, I change the long names of the columns :\n","  \n","    *clean_alternative_fuel_vehicle_cafv_eligibility*   for *eligibility*\n","  \n","    *electric_vehicle_type*  by the short ones *electric_type*.\n","  \n","* Rename rows: In those columns I also rename the long name of the rows:\n","  \n","   *Eligibililty unknown as battery range has not been researched* is changed by *unknown*,\n","\n","   *Clean Alternative Fuel Vehicle Eligible* is changed by *clean* and\n","\n","   *Not eligible due to low battery range* is changed by *negative*.\n","\n","   In the electric_type column, the row *Battery Electric Vehicle (BEV)*  is named just *battery* and the row *Plug-in Hybrid Electric Vehicle (PHEV)* is called \"hybrid\" for short."]},{"cell_type":"code","execution_count":8,"id":"8d4f5ce1","metadata":{"_cell_guid":"dfddc661-d04e-44a8-ae2a-a3bc36ac411d","_uuid":"92c1aa07-a748-4da5-bafa-7b194bb8bcad","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:30:18.856578Z","iopub.status.busy":"2025-05-13T18:30:18.854944Z","iopub.status.idle":"2025-05-13T18:30:19.570236Z","shell.execute_reply":"2025-05-13T18:30:19.56828Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.738825,"end_time":"2025-05-13T18:30:19.572892","exception":false,"start_time":"2025-05-13T18:30:18.834067","status":"completed"},"tags":[]},"outputs":[],"source":["# select data and rename columns and rows\n","sf <- data %>% \n","  select(city, clean_alternative_fuel_vehicle_cafv_eligibility, \n","         model_year, make, model, electric_range, electric_vehicle_type)  %>%\n","  rename(eligibility = clean_alternative_fuel_vehicle_cafv_eligibility) %>% \n","  mutate(eligibility = ifelse(grepl(\"Clean\", eligibility), \"clean\",\n","                        ifelse(grepl(\"unknown\", eligibility), \"unknown\",\"negative\"))) %>%\n","                             # ifelse(grepl(\"not\", eligibility), \"negative\",\" \")))) %>%\n","  rename(electric_type = electric_vehicle_type) %>%\n","  mutate(electric_type = ifelse(grepl(\"Battery\", electric_type), \"battery\",\n","                          ifelse(grepl(\"Plug-in\", electric_type),\"hybrid\", \"other\")))"]},{"cell_type":"markdown","id":"61e79f84","metadata":{"_cell_guid":"08602adb-4cb3-4070-a179-d5269d067d17","_uuid":"0de38daa-87e0-4b75-af26-068c6c8fb5fd","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.018857,"end_time":"2025-05-13T18:30:19.610701","exception":false,"start_time":"2025-05-13T18:30:19.591844","status":"completed"},"tags":[]},"source":["## 3) Processing Data"]},{"cell_type":"markdown","id":"4eb65dba","metadata":{"_cell_guid":"fb163ab5-d387-4053-95aa-f00eb0f3960e","_uuid":"15e7b151-ad96-4fd3-a527-826198d598a0","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.018391,"end_time":"2025-05-13T18:30:19.647533","exception":false,"start_time":"2025-05-13T18:30:19.629142","status":"completed"},"tags":[]},"source":["After the selected columns, the new data set consists of 5 variables type character and 2 type numeric. \n","First, I analyse the numeric features *electric_range* and *model_year*.  The central tendency measures for\n","these features are given in the following table."]},{"cell_type":"code","execution_count":9,"id":"ffd5f477","metadata":{"_cell_guid":"3256c4cc-d50a-42ad-92f0-2b3fe76af448","_uuid":"11ceb997-2c8d-4005-8799-165c72fb8651","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:30:19.688017Z","iopub.status.busy":"2025-05-13T18:30:19.686305Z","iopub.status.idle":"2025-05-13T18:30:19.961724Z","shell.execute_reply":"2025-05-13T18:30:19.960001Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.298299,"end_time":"2025-05-13T18:30:19.964042","exception":false,"start_time":"2025-05-13T18:30:19.665743","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 2 × 7</caption>\n","<thead>\n","\t<tr><th scope=col>electric_type</th><th scope=col>electric_range.mode</th><th scope=col>electric_range.mean</th><th scope=col>electric_range.median</th><th scope=col>model_year.mode</th><th scope=col>model_year.mean</th><th scope=col>model_year.median</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>battery</td><td> 0</td><td>50.16380</td><td> 0</td><td>2023</td><td>2021.636</td><td>2023</td></tr>\n","\t<tr><td>hybrid </td><td>32</td><td>31.26972</td><td>30</td><td>2024</td><td>2020.527</td><td>2022</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 2 × 7\n","\\begin{tabular}{lllllll}\n"," electric\\_type & electric\\_range.mode & electric\\_range.mean & electric\\_range.median & model\\_year.mode & model\\_year.mean & model\\_year.median\\\\\n"," <chr> & <dbl> & <dbl> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t battery &  0 & 50.16380 &  0 & 2023 & 2021.636 & 2023\\\\\n","\t hybrid  & 32 & 31.26972 & 30 & 2024 & 2020.527 & 2022\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 2 × 7\n","\n","| electric_type &lt;chr&gt; | electric_range.mode &lt;dbl&gt; | electric_range.mean &lt;dbl&gt; | electric_range.median &lt;dbl&gt; | model_year.mode &lt;dbl&gt; | model_year.mean &lt;dbl&gt; | model_year.median &lt;dbl&gt; |\n","|---|---|---|---|---|---|---|\n","| battery |  0 | 50.16380 |  0 | 2023 | 2021.636 | 2023 |\n","| hybrid  | 32 | 31.26972 | 30 | 2024 | 2020.527 | 2022 |\n","\n"],"text/plain":["  electric_type electric_range.mode electric_range.mean electric_range.median\n","1 battery        0                  50.16380             0                   \n","2 hybrid        32                  31.26972            30                   \n","  model_year.mode model_year.mean model_year.median\n","1 2023            2021.636        2023             \n","2 2024            2020.527        2022             "]},"metadata":{},"output_type":"display_data"}],"source":["# central measures for the numeric features\n","\n","# mean and median for electric range and model year\n","mean.median <- sf %>% select(electric_type, model_year, electric_range) %>% \n","  group_by(electric_type) %>%\n","   summarise(across(c(electric_range, model_year), list(mean = mean, median =median), .names = \"{.col}.{.fn}\",  na.rm = TRUE))\n","\n","# Function to compute mode\n","mode <- function(x) {\n","  ux <- unique(x)\n","  ux[which.max(tabulate(match(x, ux)))]\n","}\n","\n","# compute mode\n","mode.tab <- sf %>% select(electric_range, model_year, electric_type) %>%\n","  group_by(electric_type) %>%\n","  summarise(model_year.mode = mode(model_year), electric_range.mode = mode(electric_range), .groups = \"drop\")\n","\n","# table for three central tendency measures\n","central.measures <- mode.tab %>% mutate(mean.median) %>% \n","                    relocate(contains(\"electric_range\"), .before = contains(\"model_year\"))\n","central.measures"]},{"cell_type":"markdown","id":"21ac93cd","metadata":{"_cell_guid":"9cf6683e-09ba-424a-b088-c64070f563e0","_uuid":"7b54b823-8895-48c9-ab80-72ba37c74189","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.018836,"end_time":"2025-05-13T18:30:20.002283","exception":false,"start_time":"2025-05-13T18:30:19.983447","status":"completed"},"tags":[]},"source":["###  Distribution plot for model year"]},{"cell_type":"markdown","id":"eba3e920","metadata":{"_cell_guid":"16563154-4f64-4c5f-bd42-faf1d7c8364f","_uuid":"a2e84409-9f64-49ae-b530-f05b46a92d91","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.018746,"end_time":"2025-05-13T18:30:20.039561","exception":false,"start_time":"2025-05-13T18:30:20.020815","status":"completed"},"tags":[]},"source":["For battery electric type the mode is 2023, the same as the median, and the mean is 2022.  \n","The plug-in hybrid type has: mode 2024, median 2022 and mean 2021. \n","In boths cases, the mode and median are bigger than the mean, indicating a left-skewed distributions as can be seen in the distribution plots.\n","I have used a logarithmic scale on the frequency since there is a wide range of values for it."]},{"cell_type":"code","execution_count":10,"id":"9a1abf8c","metadata":{"_cell_guid":"9083c92e-6821-414e-98dd-eb528bbdfbe1","_uuid":"53318fab-cc3a-42e2-b05b-2cd6939e0b76","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:30:20.080889Z","iopub.status.busy":"2025-05-13T18:30:20.079307Z","iopub.status.idle":"2025-05-13T18:30:20.941652Z","shell.execute_reply":"2025-05-13T18:30:20.939865Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.885704,"end_time":"2025-05-13T18:30:20.944234","exception":false,"start_time":"2025-05-13T18:30:20.05853","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9fvA8eey06aTsveeskGQpQIKylABFRAEN0NFcaC492CpgKDiF3Gh4kRw\ngAsVFQX9qShDWQoItNCW7qTJ74+U0ja99prkmsH79YeGy+VzzyfJXZ5ennuieDweAQAAQOQz\nhDoAAAAABAeJHQAAQJQgsQMAAIgSJHYAAABRgsQOAAAgSpDYAQAARAkSOwAAgChBYgcAABAl\noiGxU3yYrI76TVtfdOWtq39NK7Py5js6K4oy9KsDQQ+jzMjX149TFGVbrivoG/LdVpjI+e+L\nyQO7pTgstdvfqbZOjNHg+3qVdM4n/3jX/PXxHoqiDHx/TzVFX1rgz3Bu6tuKohiMls1ZTrV1\nBiXZFUUZq20rO1/qryhK/5d2VrCOH2EH/jxvuum0il9TrxH/d8TvTQROv/3x6Pbx3gkmt35E\ndSV3XptYi3e1LzLyA9/o/OZJiqKsPZan/SGVvtA7XrxAURSD0fb6/uxyV/C40gcm2xVFaXvN\nmqoGHDgthxcAEh2JnVfD5i2K1Um0Htq7890X54zsUn/8k58HMqzHnf3tt9/+8NM/wYozQmPQ\n4t5+Fy3/fIu5db8h/VtWvGaDZi3U1Isx6RpktT2Z9pRRV9d1eNzO297fW+4K2f89/1l6ntFc\nY17vOnoHoytbSqOSr2DzZnVFRFFMZV7Zu