 fill = electric_type)) + geom_bar(stat= \"identity\") +\n","  geom_vline(data = mean.median, aes(xintercept= model_year.mean, color = electric_type),\n","                                 linetype = \"dashed\", linewidth  =1) +\n","  #geom_label(aes(2, 1.2), label = \"Mean:${mean.median$model_year_mean}\", show.legend = FALSE) +\n","  geom_vline(data = mean.median, aes(xintercept = model_year.median, color = electric_type),\n","                              linetype = \"dotted\", linewidth = 1) +\n","  facet_wrap(~ electric_type) +\n","  xlab(\"Model Year\") + ylab(\"Frequency in log scale\") +\n","  labs(title= \"Distribution of Electric Vehicle Type by Model Year from 2000 - 2025\",  caption = \"mean and median are represented by dashed and dotted lines respectively.\") +\n","       theme(legend.position = \"none\") +\n","  scale_fill_manual(values = darkcols[5:6]) +\n","  scale_y_continuous(trans='log10',\n","                   breaks=trans_breaks('log10', function(x) 10^x),\n","                    labels=trans_format('log10', math_format(10^.x)))"]},{"cell_type":"markdown","id":"785f0713","metadata":{"_cell_guid":"985882c4-1300-47c7-ad77-fe541b83f8e3","_uuid":"b7f07162-57ae-4ca0-8fa5-03082cb67b34","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.019392,"end_time":"2025-05-13T18:30:20.983275","exception":false,"start_time":"2025-05-13T18:30:20.963883","status":"completed"},"tags":[]},"source":["\n"," Outliers are observed in the battery type case."]},{"cell_type":"markdown","id":"ae6fd568","metadata":{"_cell_guid":"2e1f9ff1-7a35-4c99-93d6-759b3bf22338","_uuid":"39cb9fd0-d347-496e-a87f-d7d4c926b659","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.019526,"end_time":"2025-05-13T18:30:21.022409","exception":false,"start_time":"2025-05-13T18:30:21.002883","status":"completed"},"tags":[]},"source":["### Distribution for electric range\n","\n","For *electric range*, the plots show right skewed distributions in