"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Distribution of make across  electric type\n","count.make <- df %>% select(model, electric_type, make) %>%\n","  group_by(electric_type) %>% \n","  count(make) %>% \n","  arrange(desc(n)) \n","\n","# plot makes vs electric type  \n","ggplot(count.make, aes(x=make, y=n , fill = electric_type)) + geom_bar(stat= \"identity\" ) +\n","  facet_grid(vars(electric_type)) +\n","  xlab(\"Make\") + ylab(\"Frequency in log scale\") +\n","   labs(title= \"Distribution of Make by Electric Type\") +\n","   theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust = 1, size = 6)) +\n","  theme(legend.position = \"none\") +\n","     scale_y_continuous(trans='log10',\n","                    breaks=trans_breaks('log10', function(x) 10^x),\n","                     labels=trans_format('log10', math_format(10^.x)))"]},{"cell_type":"markdown","id":"83240fad","metadata":{"_cell_guid":"75e5274a-afc7-4c2a-86af-a010b3eb6ed2","_uuid":"4de3a3d6-f664-4ee2-9abf-ae45dec0c762","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.034875,"end_time":"2025-05-13T18:31:13.985005","exception":false,"start_time":"2025-05-13T18:31:13.95013","status":"completed"},"tags":[]},"source":["### The first 10 manufactures with highest registration in Washington State for battery type"]},{"cell_type":"code","execution_count":40,"id":"af5066d8","metadata":{"_cell_guid":"c30ea122-7ae1-4160-93f2-2de026c2252f","_uuid":"dfe0cf89-fb28-4d8b-b554-2bf6379ccc5d","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:31:14.058272Z","iopub.status.busy":"2025-05-13T18:31:14.056715Z","iopub.status.idle":"2025-05-13T18:31:15.08295Z","shell.execute_reply":"2025-05-13T18:31:15.080979Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.065993,"end_time":"2025-05-13T18:31:15.085617","exception":false,"start_time":"2025-05-13T18:31:14.019624","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<iframe src=\"fig.html\" width=100% height=450></iframe>"]},"metadata":{},"output_type":"display_data"}],"source":["# count the number of registered vehicles by make\n","count.make.battery <- df  %>% filter(electric_type == \"battery\") %>%  \n"," group_by(make) %>%\n"," summarize(Observations.Make.Battery = n(), .groups = \"drop\") %>%\n"," arrange(desc(Observations.Make.Battery)) %>% slice(., 1:10)\n","\n","\n","# plot the number of registered vehicles by make and battery type\n","colors <- c('rgb(211,94,96)', 'rgb(128,133,133)', 'rgb(144,103,167)', 'rgb(171,104,87)', 'rgb(114,147,203)')\n","\n","fig <- plot_ly(count.make.battery, labels = ~ make, values = ~  Observations.Make.Battery, type = 'pie',\n","        textposition = 'inside',\n","        textinfo = 'label+percent',\n","        insidetextfont = list(color = '#FFFFFF'),\n","        hoverinfo = 'text',\n","        text = ~paste('$', make,  Observations.Make.Battery),\n","        marker = list(colors = colors, line = list(color = '#FFFFFF', width = 1)),  showlegend = FALSE)\n","\n","fig <- fig %>% layout(title = ' The top 10 vehicle manufactures for Battery Vehicle Type',\n","        xaxis = list(showgrid = FALSE, zeroline = FALSE, showticklabels = FALSE),\n","        yaxis = list(showgrid = FALSE, zeroline = FALSE, showticklabels = FALSE))\n","\n","htmlwidgets::saveWidget(fig, \"fig.html\")\n","\n","\n","display_html('<iframe src=\"fig.html\" width=100% height=450></iframe>')\n"]},{"cell_type":"markdown","id":"e8ea1c30","metadata":{"_cell_guid":"a49e85b5-b37a-4c43-8842-bedd1a8da089","_uuid":"0aa247f2-9091-4b4b-bdee-3f0c9c02068e","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.035068,"end_time":"2025-05-13T18:31:15.157487","exception":false,"start_time":"2025-05-13T18:31:15.122419","status":"completed"},"tags":[]},"source":["### The first 10 manufactures with highest registration in Washington State for plug-in hybrid type"]},{"cell_type":"code","execution_count":41,"id":"02b951b9","metadata":{"_cell_guid":"fbf1755e-1062-4260-b507-17929e55457d","_uuid":"cb306620-68ee-4d7e-9db1-60e2ccf883a0","collapsed":false,"execution":{"iopub.execute_input":"2025-05-13T18:31:15.230713Z","iopub.status.busy":"2025-05-13T18:31:15.22914Z","iopub.status.idle":"2025-05-13T18:31:15.41383Z","shell.execute_reply":"2025-05-13T18:31:15.412089Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.224111,"end_time":"2025-05-13T18:31:15.416047","exception":false,"start_time":"2025-05-13T18:31:15.191936","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<iframe src=\"fig.plug.html\" width=100% height=450></iframe>"]},"metadata":{},"output_type":"display_data"}],"source":["# count the number of registered vehicles by make\n","count.make.plugin <- df  %>% filter(electric_type == \"hybrid\") %>%  \n","  group_by(make) %>%\n","  summarize(Observations.Make.Plugin = n(), .groups = \"drop\") %>%\n","  arrange(desc(Observations.Make.Plugin))  %>% \n","  slice(., 1:10)\n","\n","# plot the number of registered vechicles by make and plug-in typ\n","colors  <- c(\"#999999\", \"#E69F00\", \"#56B4E9\", \"#009E73\", \"#F0E442\", \"#0072B2\", \"#D55E00\", \"#CC79A7\")\n","\n","# The palette with black:\n","fig.plug <- plot_ly(count.make.plugin, labels = ~ make, values = ~  Observations.Make.Plugin, type = 'pie',\n","              textposition = 'inside',  textinfo = 'label+percent', insidetextfont = list(color = '#FFFFFF'),                  hoverinfo = 'text', text = ~paste('$', make,  Observations.Make.Plugin),\n","              marker = list(colors = colors, line = list(color = '#FFFFFF', width = 1)), showlegend = FALSE)\n","\n","fig.plug <- fig.plug %>% layout(title = ' The top 10 vehicle manufactures for Plug-in  Vehicle Type',\n","              xaxis = list(showgrid = FALSE, zeroline = FALSE, showticklabels = FALSE),\n","              yaxis = list(showgrid = FALSE, zeroline = FALSE, showticklabels = FALSE))\n","\n","htmlwidg